import { Component } from 'react';
import './RadioButtons.css';

class RadioButtons extends Component {
  render() {
    return 
    <ul>
      <li>
        <input type="radio" name="1"><label>A</label></input>
      </li>
    </ul>;
  }
}

export default RadioButtons;
